import React from 'react'
import {Col ,Card} from 'react-bootstrap'

 const BrandCard = ({img}) => {
  return (
    <Col sm="6" className="">
    <Card className="">
    <Card.img style={{width:'100%' ,height:'151px'}} className="" src={img} />

    </Card>
    
    </Col>
  )
}
export default BrandCard
